  \"wide-throttling-high-throughput-hall-thruster-for-science-and-exploration-missions-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In response to Topic S3.04 \"Propulsion
  Systems,\" Busek Co. Inc. will develop a high throughput Hall effect thruster with
  a nominal peak power of 1-kW and wide throttling range in terms of both power and
  Isp.rn  rnIn Phase I the preliminary thruster design was completed.  Project activities
  focused on achieving a magnetic field that shields the discharge channel from ion
  induced erosion.  The goal is to achieve a propellant throughput greater than 100
  kg/kW.  Numerical modeling is playing a critical role in the thruster design.  In
  Phase I, we used a fluid based code developed by JPL to model the plasma in an existing
  thruster that is currently undergoing life testing.  The erosion predictions of
  the model were found to agree well with actual measurements.  The numerical model
  was then applied to the magnetically shielded 1-kW thruster and preliminary results
  were found to be reasonable.  The goal is to demonstrate a thruster design where
  channel erosion is entirely eliminated as a life limiting mechanism.rnrnIn Phase
  II, we will build and test the extended lifetime thruster.  The performance, lifetime,
  and plume properties of the thruster will then be evaluated, and the design will
  be optimized.  Numerical modeling will be used throughout the process to ensure
  that magnetic shielding is achieved.  Code predictions will be grounded in plasma
  measurements taken with a variety of diagnostics including channel wall probes,
  high speed intrusive channel probes, and plume probes.  The ability of the thruster
  to achieve its lifetime goals will be assessed through a 500 hour wear test.  When
  the design is finalized, an engineering development unit (EDU) thruster will be
  designed, built, validated, and delivered to NASA.  The EDU thruster design will
  be modeled thermally and structurally to facilitate the transition to Phase III.
  \ At the end of the Phase II, the TRL will be 5/6.\",\n\t\"license_title\": \"U.S.
